import Grid from './src/grid';
import { html } from './src/util/html';
import { h, createElement, Component, createRef } from 'preact';
import { useEffect, useRef, useState } from 'preact/hooks';
import { Config } from './src/config';
import { PluginPosition } from './src/plugin';
import { ID } from './src/util/id';
import { className } from './src/util/className';
import Row from './src/row';
import Cell from './src/cell';
import { useConfig } from './src/hooks/useConfig';
import { useStore } from './src/hooks/useStore';
import useSelector from './src/hooks/useSelector';
import { useTranslator } from './src/i18n/language';

export {
  Grid,
  ID,
  Row,
  Cell,
  className,
  html,
  Config,
  PluginPosition,
  h,
  createElement,
  Component,
  createRef,
  useEffect,
  useRef,
  useStore,
  useConfig,
  useState,
  useSelector,
  useTranslator,
};

const exps = require('./package.json').exports;
const roots = Object.entries(exps)
  .map((x) => !/legacy|package\.json|^\.\/$/gi.test(x[0]) ? x[0] : null)
  .filter(x => x);

module.exports = {
  testEnvironment: 'node',
  setupFilesAfterEnv: ["jest-extended/all"],
  roots: roots,
  transform: {
    '^.+\\.tsx?$': ['ts-jest', {
      ...require('./tsconfig.test.json')
    }],
  },
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json', 'node'],
  setupFiles: ['./tests/jest/setup.ts'],
  moduleNameMapper: {
    '\\.(css|less|scss|sass)$': 'identity-obj-proxy',
  },
  testRegex: '(/__tests__/.*|(\\.|/)(test))\\.(ts|js)x?$',
  coverageDirectory: 'coverage',
  collectCoverageFrom: [
    'src/**/*.{ts,tsx,js,jsx}',
    '!src/**/*.d.ts',
    '!src/**/*.test.ts',
  ],
};

